  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Fergus
  Falls Wetland Management District summarizes refuge activities during the 1993 calendar
  year.  The report begins with a summary of the yearu2019s highlights and climatic
  conditions.  Land acquisition - including fee titles and easements topics are also
  covered.  The report includes a planning section which discusses refuge management
  plans and research.  Refuge administration is outlined; information about personnel,
  refuge programs, funding and safety is given.  Habitat management is also covered.
  Subjects include croplands, grasslands, fire management and WPA Easement monitoring.
  The wildlife section of the report discusses endangered or threatened species, waterfowl,
  resident wildlife and animal control. The public uses of the refuge described in
  this report include interpretive programs, hunting, and law enforcement.  The equipment
  and facilities section of the report provides information about new construction,
  maintenance, and communications systems.  Items of interest are provided at the
  end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
